import styles from "./Business.module.css";
import BusinessList from "./BusinessList";
import PrimaryBtn from "./PrimaryBtn";


function Business() {
  return (
    <article className={styles.business}>
      <h2>BUSINESS</h2>
      <p>고객이 신뢰하는 글로벌 에너지 자원 선도 기업</p>



    <PrimaryBtn />
    <BusinessList/>
    </article>
  );
}

export default Business;
